/* Import base styles */
@import '/assets/css/base.css';

/* Canvas styles */
canvas#myCanvas {
  position: fixed;
  top: 0;
  left: 0;
  z-index: -1;
  width: 100%;
  height: 100%;
}

/* Navbar styles */
.navbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 20px 50px;
}

/* Logo image styles */
.logo {
  height: 60px;
  width: 60px;
  transition: transform 0.2s;
}

.logo:hover {
  transform: scale(1.2);
}

.cls-1 {
  fill: var(--vt-c-white);
  stroke-width: 0px;
}

.DWT img {
  width: 70px;
  text-shadow: 0px 4px 25px rgba(0, 0, 0, 0.25);
  transition: transform 0.2s;
}

.DWT img:hover {
  transform: scale(1.2);
}

/* Links styles */
.whatnext {
  position: relative;
  display: inline-block;
  cursor: pointer;
  outline: none;
  border: 0;
  vertical-align: middle;
  text-decoration: none;
  background: transparent;
  padding: 0;
  font-family: 'Geist-Black', sans-serif;
  font-size: 16px;
  width: 12rem;
  height: auto;
}

.whatnext .circle {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: relative;
  display: block;
  margin: 0;
  width: 3rem;
  height: 3rem;
  background: linear-gradient(91.29deg, #821BD3 0.23%, #BA20D3 52.52%);
  border-radius: 1.625rem;
}

.whatnext .circle .icon {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: absolute;
  top: 0;
  bottom: 0;
  margin: auto;
  background: var(--vt-c-white);
}

.whatnext .circle .icon.arrow {
  left: 0.625rem;
  width: 1.125rem;
  height: 0.125rem;
  background: none;
}

.whatnext .circle .icon.arrow::before {
  content: '';
  position: absolute;
  top: -0.25rem;
  right: 0.0625rem;
  width: 0.625rem;
  height: 0.625rem;
  border-top: 0.125rem solid var(--vt-c-white);
  border-right: 0.125rem solid var(--vt-c-white);
  transform: rotate(45deg);
}

.whatnext .button-text {
  transition: all 0.45s cubic-bezier(0.65, 0, 0.076, 1);
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  padding: 0.75rem 0;
  margin: 0 0 0 1.85rem;
  color: var(--vt-c-white);
  font-weight: 700;
  line-height: 1.6;
  text-align: center;
  text-transform: uppercase;
}

.whatnext:hover .circle {
  width: 100%;
}

.whatnext:hover .circle .icon.arrow {
  background: var(--vt-c-white);
  transform: translate(1rem, 0);
}

.whatnext:hover .button-text {
  color: var(--vt-c-white);
}

/* Main content styles */
main {
  display: block;
  scroll-snap-type: y mandatory;
  overflow-y: scroll;
  height: calc(100vh - 100px);
  z-index: 1;
  margin-top: 100px;
}

::-webkit-scrollbar {
  width: 10px;
}

::-webkit-scrollbar-track {
  background-color: none;
}

::-webkit-scrollbar-thumb {
  background: linear-gradient(45deg, #821BD3 0%, #BA20D3 100%);
  border-radius: 10px;
}

/* Section styles */

.section {
  height: calc(100vh - 140px);
  display: flex;
  justify-content: center;
  font-size: 2rem;
  transition: transform 0.5s ease-in-out;
  scroll-snap-align: start;
  z-index: 1;
  flex-wrap: wrap;
  padding-top: 50px;
  opacity: 0;
  transform: scale(0.9) translateY(50px);
  transition: opacity 0.5s ease, transform 0.5s ease;
}

.section.active {
 opacity: 1;
  transform: scale(1) translateY(0);
}

.content1 {
  display: flex;
  flex-direction: column;
  gap: 25px;
  flex: 1;
  max-width: 60%;
  margin-right: 60px;
}

.content2{
  display: flex;
  height: 70%;
  align-items: center;
  margin-left: 60px;
}

.content3{
  flex: 1;
}

.content4{
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
}

#section1 {
  display: flex;
  padding-left: 100px;
  padding-right: 100px;
}

#section4, #section5, #section6 {
  padding-left: 100px;
  padding-right: 100px;
  opacity: 1;
}

#section5 {
  align-items: center;
  flex-direction: column;
}

.mobile_img {
  width: 350px;
  transition: transform 0.3s;
}

.mobile_img:hover {
  transform: scale(1.3);
}

.wrapper {
  display: flex;  
  flex-flow: row wrap;
  text-align: center;
}

.wrapper > * {
  padding: 140px;
  flex: 1 100%;
  height: 50%;
}

.main {
  display: flex;
  flex-direction: column;
  gap: 25px;
  text-align: left;
}

.aside-2 {
  text-align: left;
  padding-left: 0;
}

.wrapper-column {
  display: flex;
  flex-direction: column;
  align-items: center;
  text-align: center;
  padding: 40px;
}

.wrapper-column > * {
  padding: 20px;
  max-width: 1200px;
}

.main-column {
  display: flex;
  flex-direction: column;
  gap: 25px;
  text-align: left;
}

.main-title {
  font-size: 140px;
  display: flex;
  justify-content: center;
}

.aside-column {
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 30px;
}

.button_example1 {
  display: flex;
  gap: 30px;
}
.button_example2 {
  display: flex;
  gap: 30px;
}

.example1, .example2, .example3, .example4, .example5{
  width: 200px;
  height: 60px;
  cursor: pointer;
  font-family: 'Geist-Bold', sans-serif;
  font-size: 16px;
  border: none;
}

.example1 {
  align-items: center;
  appearance: none;
  background-color: #FCFCFD;
  border-radius: 4px;
  border-width: 0;
  box-shadow: rgba(45, 35, 66, 0.4) 0 2px 4px,rgba(45, 35, 66, 0.3) 0 7px 13px -3px,#D6D6E7 0 -3px 0 inset;
  box-sizing: border-box;
  color: #36395A;
  cursor: pointer;
  display: inline-flex;
  font-family: "JetBrains Mono",monospace;
  height: 48px;
  justify-content: center;
  line-height: 1;
  list-style: none;
  overflow: hidden;
  padding-left: 16px;
  padding-right: 16px;
  position: relative;
  text-align: left;
  text-decoration: none;
  transition: box-shadow .15s,transform .15s;
  user-select: none;
  -webkit-user-select: none;
  touch-action: manipulation;
  white-space: nowrap;
  will-change: box-shadow,transform;
  font-size: 18px;
}

.example1:focus {
  box-shadow: #D6D6E7 0 0 0 1.5px inset, rgba(45, 35, 66, 0.4) 0 2px 4px, rgba(45, 35, 66, 0.3) 0 7px 13px -3px, #D6D6E7 0 -3px 0 inset;
}

.example1:hover {
  box-shadow: rgba(45, 35, 66, 0.4) 0 4px 8px, rgba(45, 35, 66, 0.3) 0 7px 13px -3px, #D6D6E7 0 -3px 0 inset;
  transform: translateY(-2px);
}

.example1:active {
  box-shadow: #D6D6E7 0 3px 7px inset;
  transform: translateY(2px);
}

.example2 {
  all: unset;
  width: 100px;
  height: 30px;
  font-size: 16px;
  background: transparent;
  border: none;
  position: relative;
  color: #f0f0f0;
  cursor: pointer;
  z-index: 1;
  padding: 10px 20px;
  display: flex;
  align-items: center;
  justify-content: center;
  white-space: nowrap;
  user-select: none;
  -webkit-user-select: none;
  touch-action: manipulation;
}

.example2::after,
.example2::before {
  content: '';
  position: absolute;
  bottom: 0;
  right: 0;
  z-index: -99999;
  transition: all .4s;
}

.example2::before {
  transform: translate(0%, 0%);
  width: 100%;
  height: 100%;
  background: #28282d;
  border-radius: 10px;
}

.example2::after {
  transform: translate(10px, 10px);
  width: 35px;
  height: 35px;
  background: #ffffff15;
  backdrop-filter: blur(5px);
  -webkit-backdrop-filter: blur(5px);
  border-radius: 50px;
}

.example2:hover::before {
  transform: translate(5%, 20%);
  width: 110%;
  height: 110%;
}

.example2:hover::after {
  border-radius: 10px;
  transform: translate(0, 0);
  width: 100%;
  height: 100%;
}

.example2:active::after {
  transition: 0s;
  transform: translate(0, 5%);
}

.example3 {
  padding: 0.6em 2em;
  border: none;
  outline: none;
  color: rgb(255, 255, 255);
  background: #111;
  cursor: pointer;
  position: relative;
  z-index: 0;
  border-radius: 10px;
  user-select: none;
  -webkit-user-select: none;
  touch-action: manipulation;
}

.example3:before {
  content: "";
  background: linear-gradient(
    45deg,
    #ff0000,
    #ff7300,
    #fffb00,
    #48ff00,
    #00ffd5,
    #002bff,
    #7a00ff,
    #ff00c8,
    #ff0000
  );
  position: absolute;
  top: -2px;
  left: -2px;
  background-size: 400%;
  z-index: -1;
  filter: blur(5px);
  -webkit-filter: blur(5px);
  width: calc(100% + 4px);
  height: calc(100% + 4px);
  animation: glowing-example3 20s linear infinite;
  transition: opacity 0.3s ease-in-out;
  border-radius: 10px;
}

@keyframes glowing-example3 {
  0% {
    background-position: 0 0;
  }
  50% {
    background-position: 400% 0;
  }
  100% {
    background-position: 0 0;
  }
}

.example3:after {
  z-index: -1;
  content: "";
  position: absolute;
  width: 100%;
  height: 100%;
  background: #222;
  left: 0;
  top: 0;
  border-radius: 10px;
}

.example4 {
  font-size: 16px;
  font-weight: 200;
  letter-spacing: 1px;
  padding: 13px 20px 13px;
  outline: 0;
  border: 1px solid black;
  color: var(--vt-c-white);
  cursor: pointer;
  position: relative;
  background-color: rgba(0, 0, 0, 0);
  user-select: none;
  -webkit-user-select: none;
  touch-action: manipulation;
}

.example4:after {
  content: "";
  background: linear-gradient(91.29deg, #821BD3 0.23%, #BA20D3 52.52%);
  width: 100%;
  z-index: -1;
  position: absolute;
  height: 100%;
  top: 7px;
  left: 7px;
  transition: 0.2s;
}

.example4:hover:after {
  top: 0px;
  left: 0px;
}

@media (min-width: 768px) {
  .example4 {
    padding: 13px 50px 13px;
  }
}

.example5 {
  appearance: button;
  background-color: #1899D6;
  border: solid transparent;
  border-radius: 16px;
  border-width: 0 0 4px;
  box-sizing: border-box;
  color: #FFFFFF;
  cursor: pointer;
  display: inline-block;
  font-family: din-round,sans-serif;
  font-size: 15px;
  font-weight: 700;
  letter-spacing: .8px;
  line-height: 20px;
  margin: 0;
  outline: none;
  overflow: visible;
  padding: 13px 16px;
  text-align: center;
  text-transform: uppercase;
  touch-action: manipulation;
  transform: translateZ(0);
  transition: filter .2s;
  user-select: none;
  -webkit-user-select: none;
  vertical-align: middle;
  white-space: nowrap;
  width: 100%;
}

.example5:after {
  background-clip: padding-box;
  background-color: #1CB0F6;
  border: solid transparent;
  border-radius: 16px;
  border-width: 0 0 4px;
  bottom: -4px;
  content: "";
  left: 0;
  position: absolute;
  right: 0;
  top: 0;
  z-index: -1;
}

.example5:main,
.example5:focus {
  user-select: auto;
}

.example5:hover:not(:disabled) {
  filter: brightness(1.1);
  -webkit-filter: brightness(1.1);
}

.example5:disabled {
  cursor: auto;
}

.example5:active {
  border-width: 4px 0 0;
  background: none;
}

.rond_container {
  display: flex;
  justify-content: center;
  align-items: flex-end;
  height: 100px; 
  gap: 25px;
}

.rond {
  width: 50px;
  height: 50px;
  border-radius: 50%;
  background: linear-gradient(91.29deg, #821BD3 0.23%, #BA20D3 52.52%);
  animation: rebond 3s ease-in-out infinite;
}

.rond:nth-child(2) {
  animation-delay: 0.3s;
}

.rond:nth-child(3) {
  animation-delay: 0.6s;
}

@keyframes rebond {
  0% {
    transform: translateY(0);
  }
  50% {
    transform: translateY(-40px);
  }
  100% {
    transform: translateY(0);
  }
}

@media all and (min-width: 600px) {
  .aside { flex: 1 auto; }
}

@media all and (min-width: 800px) {
  .main    { flex: 8 0px; }
  .aside-1 { order: 1; } 
  .main    { order: 2; }
  .aside-2 { order: 3; }
  .footer  { order: 4; }
}

/* Styles pour la flèche animée */
.scroll-down {
  position: absolute;
  bottom: 40px;
  left: 50%;
  transform: translateX(-50%);
  text-align: center;
  margin-top: 100px;
}

.scroll-down .arrow {
  display: inline-block;
  width: 24px;
  height: 24px;
  border-left: 6px solid var(--vt-c-white);
  border-bottom: 6px solid var(--vt-c-white);
  border-radius: 3px;
  transform: rotate(-45deg);
  animation: scroll-animation 2s infinite;
}

.scroll-down .arrow:hover {
  animation: none; 
  transform: rotate(-45deg) scale(1.2);
}

@keyframes scroll-animation {
  0% {
    transform: rotate(-45deg) translate(0, 0);
  }
  50% {
    transform: rotate(-45deg) translate(-10px, 10px);
  }
  100% {
    transform: rotate(-45deg) translate(0, 0);
  }
}

.rectangle-container-main {
  display: flex;
}

.rectangle-container {
  display: flex;
  flex-direction: column;
}

.rectangle {
  display: flex;
  flex-direction: column;
  justify-content: center;
  position: relative;
  border-radius: 30px;
  box-shadow: 0 0 20px 1px #000000;
  background-color: var(--vt-c-grey);
  margin: 30px;
  padding: 0 50px;
  cursor: pointer;
  transition: all 0.3s ease;
  width: 350px;
  height: 250px;
  transition: transform 0.3s;
}

.rectangle h5 {
  margin-bottom: 10px;
  background: linear-gradient(91.29deg, #BA20D3 0.23%, #821BD3 52.52%);
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
}

.rectangle img {
  display: block;
  opacity: 0;
  transition: opacity 0.3s ease;
  width: 100%;
  height: 100%;
  object-fit: cover;
  position: absolute;
  top: 0;
  left: 0;
  border-radius: 30px;
  z-index: 0;
}

.rectangle:hover {
  transform: scale(1.1);
  z-index: 2;
}

.rectangle:hover img {
  opacity: 1;
}

.rectangle::before {
  content: "";
  position: absolute;
  top: -5px;
  left: -5px;
  right: -5px;
  bottom: -5px;
  border-radius: 35px;
  background: linear-gradient(45deg, #821BD3, #BA20D3);
  z-index: -1;
  opacity: 0;
  transition: opacity 0.3s ease;
}

.rectangle:hover::before {
  opacity: 1;
}

h5.summary {
  font-size: 24px;
}

.badge {
  position: absolute;
  top: -20px;
  left: -20px;
  width: 40px;
  height: 40px;
  background-color: var(--vt-c-grey);
  border: solid 2px var(--vt-c-rose);
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 16px;
}

.button-container {
  gap: 40px;
}

.highlight {
  background: linear-gradient(91.29deg, #BA20D3 0.23%, #821BD3 52.52%);
  font-family: 'Geist-Black', sans-serif;
  -webkit-background-clip: text;
  -webkit-text-fill-color: transparent;
  background-clip: text;
}

.block_container {
  display: flex; 
  justify-content: center;
  align-items: center;
  gap: 50px;
  margin-bottom: 70px;
}

.block {
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 20px;
  text-align: center; 
  padding: 25px;
  border-radius: 30px;
  color: var(--vt-c-black);
}

.block p{
  font-size: 16px;
}

.block a{
  transition: transform 0.3s;
}

.block a:hover{
  transform: scale(1.2);
}

.block_container .block {
  width: 400px;
  height: 200px; 
  background-color: var(--vt-c-white);
  box-shadow: 0 0 20px 1px #000000;
  max-height: 200px;
  max-width: 400px;
  overflow: hidden;
  flex-grow: 1;
}

.block img {
  width: 160px;
  height: auto; 
}

/* Button styles */

.button {
  font-size: 16px;
  font-family: 'Geist-Bold', sans-serif;
  padding: 15px 25px;
  background-color: transparent;
  border: none;
  border-radius: 30px;
  position: relative;
  overflow: hidden;
  cursor: pointer;
  transition: transform 0.3s;
  margin-right: 5px;
}

.button img {
  width: 20px;
}

.button:hover {
  transform: scale(1.1);
}

.button:hover .wave {
  top: -120px;
}

.button span {
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 10px;
  position: relative;
  z-index: 1;
  color: var(--vt-c-white);
  font-size: 16px;
}

.button .wave {
  width: 220px;
  height: 220px;
  background: linear-gradient(90deg, #821BD3 0.23%, #BA20D3 52.52%);
  box-shadow: 0px 4px 25px 5px rgba(0, 0, 0, 0.25);
  position: absolute;
  left: 0;
  top: 60px;
  transition: 0.6s;
}

.button .wave::before,
.button .wave::after {
  width: 175%;
  height: 175%;
  content: '';
  position: absolute;
  top: 0;
  left: 50%;
  transform: translate(-50%, -75%);
}

.button .wave::before {
  border-radius: 45%;
  background-color: var(--vt-c-grey);
}

.button .wave::after {
  border-radius: 40%;
  background-color: var(--vt-c-grey);
}

@keyframes wave {
  0% {
    transform: translate(-50%, -75%) rotate(0deg);
  }
  100% {
    transform: translate(-50%, -75%) rotate(360deg);
  }
}

/* Footer styles */
footer {
  
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100%;
  height: 90px;
  bottom: 0;
  text-align: center;
}

/* Mac window styles */

.mac-window {
  width: 65%;
  height: 75%;
  background: rgba(0, 0, 0, 0.4);
  border-radius: 30px;
  overflow: hidden;
}

.mac-header {
  display: flex;
  justify-content: flex-end;
  padding: 10px;
  background: rgba(255, 255, 255, 0.5);
  border-radius: 30px 30px 0 0;
}

.mac-dot {
  height: 15px;
  width: 15px;
  border-radius: 50%;
  margin-right: 10px;
}

.mac-content {
  padding: 40px;
}

.mac-menu {
  display: flex;
  align-items: center;
  justify-content: space-between;
  z-index: 2;
}

.menu-item {
  font-size: 24px;
  margin: 0 10px;
  cursor: pointer;
  padding: 5px 5px;
  border-radius: 30px;
}

.menu-item:hover, .menu-item.active {
  background: linear-gradient(90deg, #821BD3 0.23%, #BA20D3 52.52%);
}

.line {
  height: 1px;
  background-color: #ccc;
  margin: 10px 0;
}

.content {
  display: flex;
  transition: transform 0.3s ease-in-out;
}

.content-item {
  min-width: 100%;
  display: none;
}

.content-item.active {
  display: block;
}

.red {
  background: rgba(255, 0, 0, 0.5);
}

.red:hover {
  background: red;
}

.yellow {
  background: rgba(255, 92, 0, 0.5);
}

.yellow:hover {
  background: orange;
}

.green {
  background: rgba(82, 255, 0, 0.5);
}

.green:hover {
  background: greenyellow;
}

.mac-content {
  padding: 40px;
}

.mac-menu {
  display: flex;
  justify-content: center;
  align-items: center;
  padding-bottom: 40px;
  position: relative;
}

.arrow {
  background: none;
  border: none;
  color: var(--vt-c-white);
  font-size: 1.5rem;
  cursor: pointer;
  z-index: 1;
}

.menu-text {
  overflow: hidden;
  width: 70%;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
}

.menu-items {
  display: flex;
  transition: transform 0.5s ease;
  position: relative;
  width: 100%;
  justify-content: center;
}

.menu-item {
  min-width: 200px;
  text-align: center;
  margin: 0 10px;
  transition: transform 0.5s ease, opacity 0.5s ease;
  cursor: pointer;
}

.menu-item:hover {
  transform: scale(1.1);
}

.menu-item.previous,
.menu-item.next {
  transform: scale(0.8);
  opacity: 0.5;
}

.menu-item.previous:hover,
.menu-item.next:hover {
  transform: scale(1);
  opacity: 1;
}

.content-item.active {
  display: block;
  margin-top: 20px;
}

.arrow.right-arrow:hover {
  transform: scale(1.3);
}

.arrow.left-arrow:hover {
