/* Waves Effect */

.block {
  width: 100%;
  height: 175px;
  background-color: transparent;
}

.waves-container {
  position: fixed;
  width: 100%;
  height: 175px;
  overflow: hidden;
  z-index: -1;
}

.waves {
  position: fixed;
  height: 175px;
}

.wave {
  position: fixed;
  bottom: 0;
  left: 0;
  background: url(/assets/img/wave.png);
  width: 100%;
  height: 175px;
  background-size: 1500px 200px;
}

.following {
  width: 100%;
  height: 175px;
  background-color: #BA20D3;
}

#wave1 {
  bottom: 0;
  opacity: 1;
  z-index: 5;
  animation: wave_moving 10.5s infinite linear;
}

#wave2 {
  bottom: 10px;
  opacity: 0.5;
  z-index: 4;
  animation: wave_moving_reverse 6s infinite linear;
}

#wave3 {
  bottom: 15px;
  opacity: 0.7;
  z-index: 3;
  animation: wave_moving 6.5s infinite linear;
}

#wave4 {
  bottom: 20px;
  opacity: 0.4;
  z-index: 2;
  animation: wave_moving_reverse 4.5s infinite linear;
}

#wave5 {
  bottom: 0;
  opacity: 0.5;
  z-index: 1;
  animation: wave_moving 8s infinite linear;
}

@keyframes wave_moving {
  0% {
    background-position-x: 1500px;
    transform: translateY(75px);
  }
  50% {
    transform: translateY(75px);
  }
  100% {
    background-position-x: 0px;
    transform: translateY(75px);
  }
}

@keyframes wave_moving_reverse {
  0% {
    background-position-x: 0px;
    transform: translateY(75px);
  }
  50% {
    transform: translateY(0px);
  }
  100% {
    background-position-x: 1500px;
    transform: translateY(75px);
  }
}

.path {
  stroke: black;
  stroke-width: 2;
  fill: none;
  stroke-dasharray: 1500;
  stroke-dashoffset: 1500;
  animation: draw 4s forwards;
}

.fill {
  fill: url(#paint0_linear_186_3);
  animation: fill 2s forwards;
  animation-delay: 4s;
}

@keyframes draw {
  to {
    stroke-dashoffset: 0;
  }
}

@keyframes fill {
  from {
    fill-opacity: 0;
  }
  to {
    fill-opacity: 1;
  }
}

